INSERT INTO `sos_news` (`news_id`, `headline`, `content`, `image`, `date`) VALUES
(2, 'New Website Launched!', 'November see''s the launch of Sold on Stourport''s new website. As well as all of the offers for the current month there''s also information on all retailers that are taking part in the scheme. This includes Google maps, virtual tours and photos where possible. Have a look around the new site and if you have any feedback please email it to <a href=''mailto:info@soldonstourport.co.uk''>info@soldonstourport.co.uk</a>.', 'news/images/newsite_9ad51.jpg', '2013-11-03'),
(3, 'Like us on Facebook', 'As well as checking this site for the latest news from Sold on Stourport you can also click the ''Like'' button on our <a href=''https://www.facebook.com/pages/Sold-On-Stourport/163887640425154''>Facebook page</a>. This will keep you up to date with all the latest developments with the scheme, including new retailers that are joining and the winning numbers in the monthly prize draw', 'news/images/facebook_b797.jpg', '2013-11-03'),
(4, 'Testing ', 'Testing news', 'news/images/hd_tree_wallpaper_hd.jpg,news/images/011_1005.jpeg', '2013-11-07');
